window.bookSummaryJSON = "<p>Dinara Marinova.</p> <p>She was my desire.</p> <p>My addiction.</p> <p>My downfall.</p> <p>We burned hot, a dangerous inferno that consumed us both.</p> <p>Then I uncovered who her family was, something I couldn’t accept, and I walked away, shattering us both.</p> <p>But she vanished without a trace, and no matter how hard I tried, I couldn’t find her.</p> <p>Years passed, but I never moved on.</p> <p>She became my obsession, a ghost I couldn’t escape.</p> <p>Now, she’s back.</p> <p>Cold, distant, and guarded.</p> <p>She’s nothing like the fiery woman who once burned for me.</p> <p>When an arranged marriage is set between us, she wants no part.</p> <p>But I’m not the man she remembers either.</p> <p>This time I’ll fight for her.</p> <p>I’ll take what belongs to me.</p> <p>Because she’s the one.</p> <p>The only one.</p> <p>And I won’t lose her again.</p>"; 
